import React from 'react'

import { useNavigate, Link } from 'react-router-dom'



export default function Home() {

  const processOrder = () => {
    const navigate = useNavigate()

    Math.random() > .5 ? navigate('order-success') : navigate('order-failed')
  }

  return (
    <>
      <div>Home</div>

      <button onClick={ processOrder }>Confirm Order</button>

      {/* We do not want logic to exists within the Link component */}
      <Link to={Math.random() > .5 ? 'order-success' : 'order-failed'}>Confirm Order</Link>
    </>
  )
}
